from django.db.models import Q
def search(request):
    keywords=''
    articles = []
    if request.method=='GET':
        keywords = request.GET.get('keywords','')
        articles = Article.objects.filter(Q(article_abstract__icontains=keywords)|Q(article_title__icontains=keywords)|Q(article_content__icontains=keywords)).order_by('publish_date').reverse()
    # 当前查询第几页
    page = 1
    page_str = request.GET.get('page')
    if page_str and page_str.isdigit():
        page = int(page_str)

    # 每页几篇文章
    per_page = 5
    #将数据进行分页,分成多少页，所有分页的信息
    paginator = Paginator(articles,per_page)
    #当前页的数据
    try:
        search_articles = paginator.page(page)
    except(EmptyPage,InvalidPage,PageNotAnInteger) as ex:
        search_articles = paginator.page(1)
    # #查找到的文章总量
    search_articles_num = len(articles)

    kwgs = {'search_articles':search_articles,

            'keywords':keywords,
            'search_articles_num':search_articles_num,
            }
    print(articles)
    return render(request,'search_test.html',kwgs)



